import React from "react";
import { ReactComponent as Logo } from "../../assets/logo11.svg";

import {
  HeaderContainer,
  LogoContainer,
  OptionsContainer,
  OptionLink,
} from "./header.styles";

const Header = () => (
  <HeaderContainer>
    <LogoContainer to="/">
      <Logo />
    </LogoContainer>
    <OptionsContainer>
      <OptionLink to="/about-us">About Us</OptionLink>
    </OptionsContainer>
  </HeaderContainer>
);

export default Header;
